import React from 'react';
import styles from './GuestsSection.module.css';

const guests = [
  {
    name: 'Guest One',
    title: 'AI Researcher',
    img: 'https://via.placeholder.com/400x500?text=Guest+1',
  },
  {
    name: 'Guest Two',
    title: 'Professor of Computer Science',
    img: 'https://via.placeholder.com/400x500?text=Guest+2',
  },
  {
    name: 'Guest Three',
    title: 'Tech Entrepreneur',
    img: 'https://via.placeholder.com/400x500?text=Guest+3',
  },
  {
    name: 'Guest Four',
    title: 'Data Scientist',
    img: 'https://via.placeholder.com/400x500?text=Guest+4',
  },
  {
    name: 'Guest Five',
    title: 'Ethics Researcher',
    img: 'https://via.placeholder.com/400x500?text=Guest+5',
  },
  {
    name: 'Guest Six',
    title: 'Futurist',
    img: 'https://via.placeholder.com/400x500?text=Guest+6',
  },
];

const GuestsSection = () => {
  return (
    <section className={styles.guests} data-testid="guests">
      <h2 className={styles.heading}>Guests</h2>
      <p className={styles.subheading}>Meet the world-class thinkers joining the discussion</p>
      <div className={styles.grid}>
        {guests.map((g) => (
          <div key={g.name} className={styles.card} data-testid="guest-card">
            <img src={g.img} alt={g.name} className={styles.photo} />
            <div className={styles.meta}>
              <h3 className={styles.name}>{g.name}</h3>
              <p className={styles.title}>{g.title}</p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default GuestsSection;
